실제 시험을 경험하고자 하는 수험생, 중간 점검이 필요한 수험생, 마무리 확인이 필요한 수험생을 위한 필수교재 기출문제집입니다. 기출문제는 모든 시험의 기본자료이자 최신 문제 유형을 파악하는 가장 중요한 자료입니다. 법령이 개정된 부분은 문제를 개정된 내용에 맞게 변형하여 효율적인 학습이 되도록 하였고, 기본서 진도에 맞춘 ‘단원별’ 구성으로 기본서와 기출문제집 연계학습이 가능하도록 하였습니다. 따라서 기본서와 본 기출문제집을 병행하여 학습한다면 훨씬 더 큰 학습 효과를 얻을 수 있습니다.

부록으로 제공되는 ‘한장끝장 과목별 맞춤부록’은 각 과목별 필수개념만 압축하여 한장에 담아 언제 어디서나 들고 다니며 활용할 수 있도록 하였습니다. 또한, ‘빈출지문 정리노트’를 활용하여 기출문제의 핵심만을 빠르게 정리할 수 있도록 하였으며, 실제 시험지와 동일한 양식의 ‘제31회 기출문제’를 수록하여 실전감각을 익힐 수 있도록 하였습니다.','300000','Y','02','t4',to_date('2021/07/13','RRRR/MM/DD'),'1',to_date('2021/07/12','RRRR/MM/DD'),'512');
