데스런이 직접 해왔고, 직접 가르쳐왔으며, 직접 선별한 ‘데스런 운동법’의 핵심을 전수한다. 저자는 이렇게 말한다. 어깨와 등판의 상체 운동은 크게 ‘미는 운동’과 ‘당기는 운동’으로, 코어는 크게 ‘복근’과 ‘엉덩이·하체’로 나눌 수 있다’고. 그렇게 해서 3권의 책도 이름이 지어졌다. 미는 운동은 《닥치고 데스런 - 남자는 어깨》, 당기는 운동은 《닥치고 데스런 - 남자는 등판》, 그리고 복근과 엉덩이와 하체는 《닥치고 데스런 - 남자는 코어》라고 말이다. 저자가 이 책들을 통해 각각 시키는 대로 자신의 몸무게를 사용해 충분히 밀고, 충분히 당기고, 충분히 운동하며, 그렇게 계속 따라가기만 하면 된다. 그러면 언젠가는 반드시 데스런 같은 몸을 가지고 유지하며 살아가게 될 것이다. 데스런의 몸이야말로 바로 그 증거이자 답이다.','300000','Y','03','t4',to_date('2021/07/15','RRRR/MM/DD'),'1',to_date('2021/07/14','RRRR/MM/DD'),'37');
웨이트 트레이닝 필독서, 『NEW 근육운동가이드』는 다양한 종류의 운동 방법들을 근육해부도를 통해 체계적이고 과학적으로 설명한다. 전편인 『근육운동가이드』는 웨이트 트레이닝 관련 서적 중에서 가장 많은 판매량을 기록한 서적이다. 새로이 출간된 『NEW 근육운동가이드』는 전편에서 제공했던 내용에서 부족한 점들을 보완하는 동시에 웨이트 트레이닝에서 발생하기 쉬운 부상 예방법을 근육의 매커니즘 이해 측면에서 설명한다. 생활체육지도자 자격증을 준비하는 사람들을 위한 자료 역시 첨가되었다.

피트니스 현장에서 운동을 지도하는 지도자는 실기에 대한 전문적 지식을 쌓아야 한다. 운동지도는 참여 모델링을 통해 효과가 증대되기 마련이고, 지도자는 자신이 직접 운동동작을 수행할 수 있어야 하기 때문이다. 또한 현장에서 운동을 지도하는 전문 퍼스널 트레이너나 생활체육지도자들은 상대를 지도하기 전에 먼저 스스로의 몸을 건강하고 멋지게 가꾸어야 한다. 『NEW 근육운동가이드』는 운동을 지도하는 사람들, 그리고 운동을 통해 근육질 몸매를 다지고 싶은 사람들에게 착실한 가이드를 제공한다.','100000','N','07','a001',to_date('2021/07/16','RRRR/MM/DD'),'a001',to_date('2021/07/14','RRRR/MM/DD'),'459');
