Insert into PROFIT.LESSON (LESSON_SEQ,FILE_SEQ,COMMON_SEQ,LESSON_CATEGORY_SEQ,LESSON_TITLE,LESSON_TITLE_COMMENT,LESSON_BALANCE,LESSON_FLEX,LESSON_STRONG,LESSON_CORE,LESSON_INTRO,LESSON_PRICE,LESSON_PRIVATE_FLAG,LESSON_MONTH,IN_USER_ID,IN_DATE,UP_USER_ID,UP_DATE,LESSON_HIT) values ('16','148','4','4','맨몸운동의 정석 : 코어의 힘','맨몸운동으로 기초체력 만들기','100','60','80','50','《헬스의 정석》 수피가 돌아왔다 이번엔 실전운동이다!! 운동을 하면 할수록 궁금한 건 많아지는데 딱히 물어볼 데가 없고, 인터넷 정보는 사실 확인이 어렵고, 헬스장의 ‘무늬만 고수’들의 이야기를 다 믿을 수도 없고, 트레이너의 말도 제각각 다르고 …. ‘헬스의 세계에서 길을 잃은’ 독자들에게 《헬스의 정석-이론편》은 내 몸과 운동의 원리를 제대로 알고 하는 진짜 운동이 뭔지 확실히 보여주었다. 이번엔 실전운동이다. 동작 사진만 가득한 화보집 스타일의 운동서적도, 낯선 용어 가득하고 난해한 운동 전문서도 아니다. 《헬스의 정석-근력운동편》은 구체적인 운동방법이 궁금하고, 내 몸에 최적화한 효율적인 운동 프로그램에 목말랐던 독자들을 위해 ‘어떤 운동을, 어떻게, 얼마나’ 하면 되는지 구체적으로 알려주는, 제대로 된 근력운동 가이드다. 전문서 못지않은 깊이 있는 내용도 누구나 쉽게 이해하고 따라할 수 있게 만드는 수피만의 내공을 근력운동편에서도 유감없이 발휘한다.
