Insert into PROFIT.LESSON (LESSON_SEQ,FILE_SEQ,COMMON_SEQ,LESSON_CATEGORY_SEQ,LESSON_TITLE,LESSON_TITLE_COMMENT,LESSON_BALANCE,LESSON_FLEX,LESSON_STRONG,LESSON_CORE,LESSON_INTRO,LESSON_PRICE,LESSON_PRIVATE_FLAG,LESSON_MONTH,IN_USER_ID,IN_DATE,UP_USER_ID,UP_DATE,LESSON_HIT) values ('17','145','4','3','사랑이와 필라테스의 세계로','근력에 좋은 필라테스','90','80','90','100','필라테스 창시자의 건강 철학과 오리지널 동작을 담은 『필라테스 바이블』이 판미동 출판사에서 출간되었다. 조셉 필라테스(1883~1967)는 생전에 자신만의 독특한 운동 체계인 ‘컨트롤로지(Contrology, 조절학)’를 창안하였고, 그의 사후 제자들이 이 운동에 창시자의 이름을 붙여 전 세계에 전파하였다. 이것이 오늘날 수많은 사람들에게 사랑받고 있는 ‘필라테스’다. 이 책은 필라테스 창시자가 집필한 『당신의 건강(Your Health)』(1934)과 『컨트롤로지를 통한 삶의 회복(Return to Life Through Contrology)』 (1945)의 완역 합본판이다. 건강과 운동에 대한 핵심 원리와 철학, 그리고 조셉 필라테스가 직접 시연한 34가지 오리지널 필라테스 동작이 담겨 있다. 여기에 이 책을 엮은 미국 필라테스의 권위자 저드 로빈스와 린 반 휴트-로빈스가 현대적 응용법을 덧붙였고, 조셉 필라테스의 2세대 직계 제자인 원정희 마스터가 번역과 응용 동작 시연을 맡았다. 필라테스 창시자, 국내외 최고 전문가들의 역량이 결집된 이 책은 건강의 본질을 일깨우는 동시에 올바른 방법과 자세 등을 가르쳐 주는, 필라테스 운동의 완벽한 길잡이가 되어 줄 것이다.','100000','N','02','t4',to_date('2021/07/13','RRRR/MM/DD'),'t4',to_date('2021/07/07','RRRR/MM/DD'),'8');
Insert into PROFIT.LESSON (LESSON_SEQ,FILE_SEQ,COMMON_SEQ,LESSON_CATEGORY_SEQ,LESSON_TITLE,LESSON_TITLE_COMMENT,LESSON_BALANCE,LESSON_FLEX,LESSON_STRONG,LESSON_CORE,LESSON_INTRO,LESSON_PRICE,LESSON_PRIVATE_FLAG,LESSON_MONTH,IN_USER_ID,IN_DATE,UP_USER_ID,UP_DATE,LESSON_HIT) values ('18','143','4','2','누워서 먹기만한 그대에게','지금당장 일어나시오','10','10','10','10','저자는 튼튼한 근육과 뼈 사이에서 이리 찢기고 저리 차이는 힘 받는 연부조직(연골, 힘줄, 인대)을 잘 보호하면서 꾸준히 운동할 수 있는 방법만 알게 되면 ‘척추, 관절을 다친 경험이 있는 사람들이 운동을 해야 할 지 말아야 할지’ 혹은 ‘나이가 들면서 운동을 해야 할지 말아야 할지’라는 딜레마에 빠질 필요가 없다고 말하고 있다.','200000','N','02','t4',to_date('2021/07/13','RRRR/MM/DD'),'t4',to_date('2021/07/12','RRRR/MM/DD'),'23');
Insert into PROFIT.LESSON (LESSON_SEQ,FILE_SEQ,COMMON_SEQ,LESSON_CATEGORY_SEQ,LESSON_TITLE,LESSON_TITLE_COMMENT,LESSON_BALANCE,LESSON_FLEX,LESSON_STRONG,LESSON_CORE,LESSON_INTRO,LESSON_PRICE,LESSON_PRIVATE_FLAG,LESSON_MONTH,IN_USER_ID,IN_DATE,UP_USER_ID,UP_DATE,LESSON_HIT) values ('19','18','4','1','헬스는 백년운동','죽을때까지 운동한다','100','90','90','90','여성들이 운동을 시작하는 이유 중 상당수가 ''다이어트'' 때문이다. 다이어트에 초점을 맞추다 보니, 살이 빠지지 않으면 의욕을 잃고 운동을 그만두는 경우가 많다. 운동의 목적을 ''건강''에 두면 어떨까? 퇴근 후 집에서 누워만 있던 내게 무언가 할 힘이 생기고, 영양제를 줄여도 체력이 떨어지는 느낌이 덜 나는, ''건강한 하루''를 목표로 지속해서 운동해보면 어떨까?','300000','N','11','t4',to_date('2021/07/15','RRRR/MM/DD'),'t4',to_date('2021/07/07','RRRR/MM/DD'),'29');
